import React, { useState, useEffect } from "react";
import { Helmet } from "react-helmet";
const Shop =()=>{
    const cardArr = [
        {
            id: 1,
            text: "Hey this is a test.",
            img: " ",
            like: 0
        },
        {
            id: 2,
            text: "If this works I'll call it a day.",
            img: " ",
            like: 0
        },
        {
            id: 3,
            text: "I'll drink a lot of beer.",
            img: " ",
            like: 0
        },
        {
            id: 4,
            text: "Cheers",
            img: " ",
            like: 0
        
        }]
       
    return(
        <>
          <Helmet>
             <title>Arizona Resources - Acclaimed Home Warranty : Acclaimed Home Warranty</title>
             <meta name="description" content="Arizona Resources - Acclaimed Home Warranty" />
          </Helmet>
        <div>
            <h1>Shop</h1>
           { cardArr.map((card) => 
        <ul key={card.id}>
            <p>Like Button</p>
            <button onClick={IncrementItem}>Like</button>
            <p>Dilike Button</p>
            <button onClick={DecreaseItem}>Disike</button>
            <p>Likes: {like}</p>
       
    
        </ul>
    )};
            
        </div>
        </>
    )
}
export default Shop;
